import React, {Component} from 'react';

class Movie extends Component {
  render() {
    return(
      <div
        className="movie-item"
        // key={this.props.id}
        >
        Title: {this.props.title}
        Date watched: {this.props.dateWatched}
      </div>
    );
  }
}

export default Movie;
